script: |
  super -f text -I q5765.spq | sort > q5765.out

inputs:
  - name: q5765.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 * 42 + + col1 BETWEEN ( - 36 + - col2 ) AND col2;
  - name: tab2

outputs:
  - name: q5765.out
    data: |
      46	51	23
      64	77	40
      75	67	58
